import React from "react";
import "./Nav.css";

const Navbar = () => {
  return (
    <div style={{ marginBottom: "-10px" }}>
      <ul>
        <li>
          <a href="/">Home</a>
        </li>

        <li>
          <a href="/contact">Contact</a>
        </li>
        <li>
          <a href="/about">About</a>
        </li>
        <li
          style={{
            float: "right",
            backgroundColor: "white",
            marginTop: "3px",
          }}
        >
          <a href="/login">LogIn</a>
        </li>
      </ul>
    </div>
  );
};

export default Navbar;
